import React from 'react';
import { TextField } from '@material-ui/core';

function Sokpage() {
    return (
        <form name="sokeform" action="#" onSubmit={(e) => e.preventDefault()}>
            <TextField fullWidth label="Søk på organisasjonsnummer" />
        </form>
    );
}

export default Sokpage;
